(15,	'{\"version_info\":{\"id\":\"15\",\"release\":1459548000,\"name\":\"osu!2016\",\"version\":\"b2016.0403.6\"},\"archive_info\":{\"archiver\":\"peppy (osu osx)\",\"archiver_url\":\"\",\"archiver_id\":\"2\",\"description\":\"A stable fallback build from 2016 found in the osu! forums and the very last stable fallback build to ever be released. This build, despite being from early 2016, still retains a lot of assets from 2015 versions.\",\"description_short\":\"\",\"auto_update\":false,\"requires_supporter\":false,\"allows_comments\":true,\"group\":1,\"approved\":true,\"video\":\"\",\"extra_info\":\"You can still connect to the official osu! server with this build, although it won\'t let you submit any scores.\"},\"stats\":{\"views\":\"1604\",\"downloads\":\"415\"},\"downloads\":{\"main\":{\"name\":\"Osekai Servers\",\"link\":\"b2016.0403.6.7z\"},\"google\":{\"name\":\"Google Drive Mirror\",\"link\":\"https:\\/\\/drive.google.com\\/file\\/d\\/1vXMZ9I7-t3caMhzlW9_Gjjb66mXvL6Mf\\/view?usp=drivesdk\"}},\"screenshots\":[\"b2016.0403.6_1.jpg\",\"b2016.0403.6_2.jpg\",\"b2016.0403.6_3.jpg\",\"b2016.0403.6_4.jpg\"]}',	1861,	505,	'2016-04-01 22:00:00',	NULL),
(16,	'{\"version_info\":{\"id\":\"16\",\"release\":1459202400,\"name\":\"osu!2016\",\"version\":\"b20160401cuttingedge\"},\"archive_info\":{\"archiver\":\"CrazyCSIW6\",\"archiver_url\":null,\"archiver_id\":\"14311450\",\"description\":\"The cuttingedge version of the 2016 April Fools client! This version, as expected, contains 2016\'s April Fools joke which was a \\\"new and improved Auto\\\". This version of Auto, also known as \\\"dancing pippi\\\" in its replay name or more commonly known as \\\"drunk Auto\\\", has an extremely wobbly aim spinning around in a circle pattern around hitobjects, yet somehow it still manages to hit 300s on every element of the map.\",\"description_short\":\"The cuttingedge version of the 2016 April Fools client!\",\"auto_update\":false,\"requires_supporter\":false,\"allows_comments\":true,\"group\":1,\"approved\":true,\"video\":\"\",\"extra_info\":\"<br> <figure>     <blockquote>         <p>The animated fictional character named and referred to as \\\"pippi\\\" which sexually identifies as a woman is currently in the state of constant rhythmical movement often known as dancing by conscious living creatures called \\\"Homo sapiens\\\", more commonly known as \\\"humans\\\" by their own race.<\\/p>     <\\/blockquote>     <figcaption>\\u2014ILuvSkins<\\/figcaption>\"},\"stats\":{\"views\":\"1369\",\"downloads\":\"194\"},\"downloads\":{\"main\":{\"name\":\"Osekai Servers\",\"link\":\"b20160401cuttingedge.zip\"}},\"screenshots\":[\"b20160401cuttingedge_1.jpg\",\"b20160401cuttingedge_2.jpg\",\"b20160401cuttingedge_3.jpg\"]}',	1507,	200,	'2016-03-28 22:00:00',	NULL),
(17,	'{\"version_info\":{\"id\":\"17\",\"release\":1459288800,\"name\":\"osu!2016\",\"version\":\"b20160331.2\"},\"archive_info\":{\"archiver\":\"Cherry \\/ CrazyCSIW6\",\"archiver_url\":null,\"archiver_id\":\"\",\"description\":\"The cuttingedge version of the 2016 April Fools client! This version, as expected, contains 2016\'s April Fools joke which was a \\\"new and improved Auto\\\". This version of Auto, also known as \\\"dancing pippi\\\" in its replay name or more commonly known as \\\"drunk Auto\\\", has an extremely wobbly aim spinning around in a circle pattern around hitobjects, yet somehow it still manages to hit 300s on every element of the map.\",\"description_short\":\"The stable version of the 2016 April Fools client!\",\"auto_update\":false,\"requires_supporter\":false,\"allows_comments\":true,\"group\":1,\"approved\":true,\"video\":\"\",\"extra_info\":\"<br> <figure>     <blockquote>         <p>The animated fictional character named and referred to as \\\"pippi\\\" which sexually identifies as a woman is currently in the state of constant rhythmical movement often known as dancing by conscious living creatures called \\\"Homo sapiens\\\", more commonly known as \\\"humans\\\" by their own race.<\\/p>     <\\/blockquote>     <figcaption>\\u2014ILuvSkins<\\/figcaption>\"},\"stats\":{\"views\":\"853\",\"downloads\":\"208\"},\"downloads\":{\"main\":{\"name\":\"Osekai Servers\",\"link\":\"b20160331.2.zip\"}},\"screenshots\":[\"b20160331.2_1.jpg\",\"b20160331.2_2.jpg\",\"b20160331.2_3.jpg\"]}',	948,	249,	'2016-03-29 22:00:00',	NULL),
